window.bookSummaryJSON = "<p>Lose yourself in the descriptions of pattern, texture, and color of fabric while hunting for antique quilts at yard sales, junk shops, and country stores. </p> <p>Bedtime stories are narrated by the world’s most celebrated voices and written with no beginning, middle, or end so you don’t stay up to hear what happens next. They're interesting enough to give your mind something to focus on but delivered in a way that encourages sleep. </p> <p>This title is part of the Audible Sleep Collection, exclusive audio experiences created to invite relaxation and sleep. New and free for members.</p>"; 
